import React, {Component} from 'react'
import AuthenticationService from './AuthenticationService.js'

class ListTodosComponent extends Component {
    constructor(props) {
        super(props)
        this.state = {
            todos:
                [
                    { id: 1, description: 'Hired in Huawei', done: false, targetDate: new Date() },
                    { id: 2, description: 'Expert in English', done: false, targetDate: new Date() },
                    { id: 3, description: 'Move to Germnay', done: false, targetDate: new Date() }
                ]

        }
    }
    render() {
        return (
            <div>
                <h1>List Todos</h1>
                <div className="container">
                <table className="table">
                    <thead>
                        <tr>
                            <th>description</th>
                            <th>Done</th>
                            <th>Date</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.todos.map(
                                todo =>
                                    <tr key={todo.id}>
                                        <td>{todo.description}</td>
                                        <td>{todo.done.toString()}</td>
                                        <td>{todo.targetDate.toString()}</td>
                                    </tr>

                            )

                        }
                    </tbody>
                </table>
                </div>
            </div>
        )
    }
}

export default ListTodosComponent
